import React from 'react';
import { css } from 'glamor';

const NewsListItems = ({item}) => {

  let news_item = css({
    padding:'20px'
  })

  return (
    <>
        <div className="news_item">
          <h3>{ item.title }</h3>
          <div>
            { item.feed }
          </div>
        </div>
    </>
    )
}

export default NewsListItems;
